import React from 'react';

const Titles = (props) =>{
  return (
    <div class='header'>
      <h1 class='title'>LitSearch</h1>
      <h2 class='description'>Search literature for analytical evidence with machine learning</h2>
    </div>
  )
}
export default Titles;
